import ExpenseItem from "./Expenseitem";
function Expenses({ title, amount, date }) {
  return (
    <div>
      <ExpenseItem title={title} amount={amount} date={date} />
      <ExpenseItem title={title} amount={amount} date={date} />
      <ExpenseItem title={title} amount={amount} date={date} />
      <ExpenseItem title={title} amount={amount} date={date} />
    </div>
  );
}
export default Expenses;
